import React from 'react';
import ""
export default function Card(props) {
  return (
    <div className="max-w-sm bg-white border border-gray-200 rounded-lg shadow">
      <a href={props.link} className="block relative">
        <img
          className="w-full h-48 object-cover rounded-t-lg card-image"
          src={props.imageSrc}
          alt={props.title}
        />
      </a>
      <div className="p-5">
        <a href={props.link}>
          <h5 className="mt-2 mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white hover:text-blue-700">
            {props.title}
          </h5>
        </a>
      </div>
    </div>
  );
}
